import React from 'react';
import './Header.css';
const Header = () => {
    return(
        <div>
            <div class="title"><h2>Food Funnel</h2></div>
        <div class="autentication">
            <button>LogIn</button>
            <button>Sign In</button>
        </div>
        </div>
    )
}
export default Header;
